import React from "react";
import { Link, Outlet } from "react-router-dom";

export default function CustomerDashboard() {
  return (
    <div style={{ display: "flex", minHeight: "calc(100vh - 40px)" }}>
      <aside style={{ width: 220, padding: 16, background: "#f8fafc", borderRight: "1px solid #e5e7eb" }}>
        <h3>Customer</h3>
        <ul style={{ listStyle: "none", padding: 0, margin: 0 }}>
          <li><Link to="/customer/dashboard">Dashboard</Link></li>
          <li><Link to="/customer/products">Products</Link></li>
          <li><Link to="/customer/orders">My Orders</Link></li>
          <li><Link to="/customer/profile">Profile</Link></li>
        </ul>
      </aside>
      <main style={{ flex: 1, padding: 16 }}>
        <Outlet />
      </main>
    </div>
  );
}
